import React from 'react';
import './orders.css';

function Orders(props) {
    return (
        <div id="orders">
            <ul id="orders-list">
                <li onClick={props.selectMeal}>Completo - Nicolas</li>
                <li onClick={props.selectMeal}>Completo - Chanchito Feliz</li>
                <li onClick={props.selectMeal}>Hamburguesa - Felipe</li>
            </ul>
        </div>
    );
}

export default Orders;
